import React from 'react';
import { NavLink } from 'react-router-dom'
import NavbarBarnd from '../Images/navbarBrand.svg'
import Styles from './SideNav.module.css'

const SideNav = () => {
    return (<>
        <nav className="fixed-top align-top" role="navigation">
            <div className="simplebar-content">
                <NavbLink exact to="/" className="sidebar-brand"><img src={NavbarBarnd} alt="Logo" className={Styles.brandImg} />
                    <span className="align-middle">Live Covid19 Tracker</span>
                </NavbLink>
            </div>
        </nav>
    </>);
}

export default SideNav;
